import React, { Component } from 'react';
import './Profile.css';

const Profile = () => {
    return (
        <nav className='profile'>
            <center>
         <div className='items'><img width="150px" src='https://sun9-26.userapi.com/impf/c846520/v846520497/143c47/BJnz-LBzzOo.jpg?size=200x0&quality=90&crop=1059,169,899,1269&sign=6c20964b305f6dc10933ab8e3fdacdda&ava=1'/></div>
         </center>
         <center><b><div>Sasha Malaahov</div></b></center>
        <div> <center>Frontend Developer</center></div>
        <br></br>
        <div><center>Following:</center></div>
        <div><center><b>34</b></center></div>
        <br></br>
        <div><center>Followers:</center></div>
        <div><center><b>155</b></center></div>
        <br></br>
        <center><div className='item'><b>View Profile</b></div></center>
      </nav>
    )
}

export default Profile;
